import Navbar from "../components/Navbar";
import { Link } from "react-router-dom";
import logo from "../image/logo.png";
// import "./Services.css";

function Services() {
  return (
    <div className="Services h-screen">

      <Navbar/>
      <div className="w-[300px] h-[200px] perspective-1000">
      <div className="relative w-full h-full transform-style-3d transition-transform duration-[1000ms] hover:rotate-y-180">
        {/* Front Side */}
        <div className="absolute w-full h-full bg-[#6A2C70] text-white flex justify-center items-center border-10 border-[#6A2C70] rounded-xl backface-hidden">
          <p className="text-2xl">Front Side</p>
        </div>

        {/* Back Side */}
        <div className="absolute w-full h-full bg-[#F08A5D] text-white flex justify-center items-center border-10 border-[#F08A5D] rounded-xl backface-hidden transform rotate-y-180">
          <p className="text-2xl">Back Side</p>
        </div>
      </div>
    </div>
    </div>
  );
}

export default Services;
